export function myCardData(picture, title, description){
    this.picture = picture;
    this.title = title;
    this.description = description;
}

export var tmp = [];
tmp = [new myCardData("ss", "ok", "iy"), new myCardData("ss", "this is [70] title", "iy")];
tmp.push(new myCardData("ss", "HEYHEYU", "ily"));
